import React from 'react';

const VideoBlock = ({ videoUrl }) => (
  <div className="block video-block">
    <h2>Pose Animation</h2>
    {videoUrl ? (
      <video src={videoUrl} controls autoPlay loop width="100%" />
    ) : (
      <p>No Video Available</p>
    )}
  </div>
);

export default VideoBlock;
